CREATE TABLE IF NOT EXISTS public.book_master
(
    book_id character varying(500) COLLATE pg_catalog."default" NOT NULL,
    title character varying(255) COLLATE pg_catalog."default" NOT NULL,
    author character varying(255) COLLATE pg_catalog."default" NOT NULL,
    genre character varying(100) COLLATE pg_catalog."default",
    publisher character varying(255) COLLATE pg_catalog."default",
    isbn character varying(20) COLLATE pg_catalog."default",
    book_language character varying(50) COLLATE pg_catalog."default",
    total_copies integer NOT NULL,
    available_copies integer NOT NULL,
    shelf_location character varying(100) COLLATE pg_catalog."default",
    is_deleted boolean DEFAULT false,
    deleted_at timestamp without time zone,
    created_at timestamp without time zone DEFAULT CURRENT_TIMESTAMP,
    updated_at timestamp without time zone DEFAULT CURRENT_TIMESTAMP,
    CONSTRAINT book_master_pkey PRIMARY KEY (book_id),
    CONSTRAINT book_master_isbn_key UNIQUE (isbn),
    CONSTRAINT book_master_total_copies_check CHECK (total_copies >= 0),
    CONSTRAINT book_master_available_copies_check CHECK (available_copies >= 0),
    CONSTRAINT chk_copies CHECK (available_copies <= total_copies)
);

